import { Component } from "react";
import { Link } from "react-router-dom";
import { NavList } from "./NavList";
import {Ug} from './images/PG.jpg'
import './images/NavbarCoureses.css'
import Logo from './images/logo2.jpeg';
import { FooterContant } from "./FooterContant";



import { permaLinks } from "./FooterContant";
import { Footer } from "./Footer";

class NavbarCoureses extends Component{
    render(){
        return(
            <>
            <nav className="" style={{height: '100vh'}}>
                <div className="main-img-contant" style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
                <img src={Logo} width={500} h  alt="" />

                </div>
                <h3 style={{textAlign: 'center'}}>...tutoring by grads from IIT/IISc</h3>

                {/* menu icons */}
                <div className="menu-icons">
                    <i className=''></i>
                </div>

                {/* nav-links for ug pg mba ca */}
                <div className="">
                <div className="nav-cords">
                    {NavList.map((item,index) => {
                        return(
                            <div key={index}  className="main-card card" >

                                <img src={item.src} width={400} alt=""/>
                                <div className="intro1">
                                <h2 className=""> {item.title}</h2>
                                <ul className="links">
                                   <Link to={item.url}>
                                    <li>{item.title1}</li>
                                    <li>{item.title2}</li>
                                    <li>{item.title3}</li>                  
                                    <li>{item.title4}</li>
                                    </Link>
                                </ul>
                                </div>
                            </div> 
                        )
                    })}
                  </div>
                </div>
               <div style={{paddingTop: '1rem'}}>
               <Footer/>
               </div>
            </nav>

            </>
        )
    }
}

export default NavbarCoureses;
